import React, {Component} from 'react';
import Navbar from './Navbar';
import './Projects.css';

class Projects extends Component {
    constructor(props) {
        super(props);
        this.myFilter = this.myFilter.bind(this);
    }

    myFilter(param) {
        switch(param) {
            case "about":
                document.getElementById('nav-about').classList.add('current');
                break;
            case "projects":
                document.getElementById('nav-projects').classList.add('current');
                break;
            case "work":
                document.getElementById('nav-work').classList.add('current');
                break;
            default:
                break;
        }
    }

    render() {
        return (
            <div> 
                <Navbar page="projects"/>
                <div className="projectsPage">
                    <div className="projectsTop">
                        <h1 className="projectsHeader"> PROJECTS </h1> 
                        <div className="projectsFilter">
                            <div className="filterButton selected" onClick={() => this.myFilter("all")}> all projects </div>
                            <div className="filterButton" onClick={() => this.myFilter("personal")}> personal </div>
                            <div className="filterButton" onClick={() => this.myFilter("work")}> work </div>
                            <div className="filterButton" onClick={() => this.myFilter("coursework")}> coursework </div>
                        </div>
                    </div>
                </div>    
            </div>
        );
    }
}

export default Projects;
